--
-- 表的结构 `t_user`
--

CREATE TABLE `t_user` (
  `id` bigint(20) NOT NULL COMMENT 'id',
  `platform` int(11) NOT NULL COMMENT '平台',
  `platformUserId` varchar(100) NOT NULL COMMENT '平台用户id',
  `name` varchar(100) DEFAULT '' COMMENT '名字',
