  `forbid` int(11) DEFAULT '0' COMMENT '禁号 0正常 1禁号',
  `forbidTime` bigint(20) DEFAULT '0' COMMENT '封号时间',
  `forbidEndTime` bigint(20) DEFAULT '0' COMMENT '封号结束时间',
  `forbidName` varchar(256) DEFAULT '' COMMENT '封号人',
  `forbidText` varchar(256) DEFAULT '' COMMENT '禁号原因',
  `onlineTime` int(11) DEFAULT '0' COMMENT '当天在线时长秒',
  `onlineDay` int(11) DEFAULT '0' COMMENT '一年中的第几天',
  `deviceInfo` varchar(256) DEFAULT '' COMMENT '设备信息'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

